import React from 'react';
import images from '../images/main.jpg';
import Birth from './Slider';
import Best from './Best';
import styled from 'styled-components'


const MainBlock = styled.div`
  display: flex;
  @media screen and (max-width: 100%) {
    width: 100%;
    overflow-x: auto;
  }
`;
const Main = () => {
    return(
        <>
        <MainBlock>
        <img src={images}
        width="100%"
        height='800px'
        alt='flower'
        />
        <Birth />
        <Best />
        </MainBlock>



        </>

    );
};

export default Main;
